import React from "react";
import Button from '@mui/material/Button';
import TextField from '@mui/material/TextField';
import Box from '@mui/material/Box';
import Typography from '@mui/material/Typography';
import IconButton from '@mui/material/IconButton';
import VisibilityIcon from '@mui/icons-material/Visibility';
import VisibilityOffIcon from '@mui/icons-material/VisibilityOff';
import Link from '@mui/material/Link';

const initialObject = {
  username: "",
  email: "",
  password: "",
};

function RegistrationForm(props) {
  const [formInitData, setFormInItData] = React.useState(initialObject);
  const [passwordVisible, setPasswordVisible] = React.useState(false);

  const handlePasswordShow = () => {
    setPasswordVisible(!passwordVisible);
  }

  const handleInputFields = (e) => {
    let updateValue = { ...formInitData };
    updateValue[e.target.name] = e.target.value;
    setFormInItData(updateValue);
  }

  const handleSubmit = (event) => {
    event.preventDefault();
    const data = new FormData(event.currentTarget);
    console.log(data)
    // if(username === ""){
    //   console.log("Please enter User Name.")
    // }
    console.log({
      username: data.get('username'),
      email: data.get('email'),
      password: data.get('password'),
    });
  };

  return (
    <Box
      sx={{
        my: 3,
        mx: 4,
        pt: 5,
        pb: 5,
        display: 'flex',
        flexDirection: 'column',
        alignItems: 'center',
        borderTop: '1px solid gray',
        borderBottom: '1px solid gray'
      }}
    >
      <Typography className="full-width" component="h1" variant="h4" sx={{ mb: 2 }}>
        Sign in to Travelguru
      </Typography>
      <Typography variant="subtitle1" gutterBottom>
        Don't have an account? <Link color="#FF4F57" href="/">Sign up</Link>
      </Typography>
      <Box component="form" noValidate onSubmit={handleSubmit} sx={{ mt: 1 }}>
        <TextField
          value={formInitData.username}
          onChange={handleInputFields}
          margin="normal"
          required
          fullWidth
          id="username"
          label="Username"
          name="username"
          autoComplete="username"
          autoFocus
        />
        <TextField
          value={formInitData.email}
          onChange={handleInputFields}
          margin="normal"
          required
          fullWidth
          id="email"
          label="Email Address"
          name="email"
          autoComplete="email"
          autoFocus
        />
        <TextField
          value={formInitData.password}
          onChange={handleInputFields}
          margin="normal"
          required
          fullWidth
          name="passworddda"
          label="Password"
          type="password"
          id="password"
          autoComplete="current-password"
        />
        {/* <IconButton sx={{ ml: 1 }} onClick={handlePasswordShow} color="inherit">
          {passwordVisible === false ? <VisibilityIcon /> : <VisibilityOffIcon />}
        </IconButton> */}

        <Button
          type="submit"
          fullWidth
          variant="contained"
          className="btn-prm"
          sx={{ mt: 3 }}
        >
          Continue
        </Button>
      </Box>
    </Box>

  );
}

export default RegistrationForm;
